// src/App.jsx
import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { LanguageProvider } from "./i18n/LanguageContext";
import { DesignConditionsForm } from "./modules/designConditions";
import { TrafficEstimationModule } from "./modules/trafficEstimation";
import { FivSpeedGradeModule, FivTableView } from "./modules/fivSpeedGrade";
import DataCatalog from "./modules/dataTables/DataCatalog";
import TableViewer from "./modules/dataTables/TableViewer";

export default function App() {
  return (
    <BrowserRouter>
      <LanguageProvider>
        <div style={{ padding: 12 }}>
          <nav style={{ marginBottom: 12 }}>
            <Link to="/">Home</Link>{" "}|{" "}
            <Link to="/catalog">Data Catalog</Link>
          </nav>
          <Routes>
            <Route
              path="/"
              element={(
                <>
                  <DesignConditionsForm />
                  <TrafficEstimationModule />
                  {/* <FivSpeedGradeModule /> */}
                  <FivTableView />
                </>
              )}
            />
            <Route path="/catalog" element={<DataCatalog />} />
            <Route path="/tables/:file" element={<TableViewer />} />
          </Routes>
        </div>
      </LanguageProvider>
    </BrowserRouter>
  );
}
